#
# TABLE STRUCTURE FOR: blogPage
#

DROP TABLE IF EXISTS `blogPage`;

CREATE TABLE `blogPage` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `readers_amount` int(10) unsigned DEFAULT NULL,
  `posts_amount` int(10) unsigned DEFAULT NULL,
  `welcome_post` text COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `priority_post` text COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=301 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: blogPost
#

DROP TABLE IF EXISTS `blogPost`;

CREATE TABLE `blogPost` (
  `body` text COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `post_created` datetime DEFAULT current_timestamp(),
  `post_updated` datetime DEFAULT current_timestamp(),
  `blogPage_id` int(10) unsigned NOT NULL,
  `blogPost_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  PRIMARY KEY (`blogPost_id`)
) ENGINE=InnoDB AUTO_INCREMENT=301 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: commun
#

DROP TABLE IF EXISTS `commun`;

CREATE TABLE `commun` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `member_amount` int(10) unsigned DEFAULT NULL,
  `welcome_post` text COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `priority_post` text COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `private` tinyint(1) DEFAULT NULL,
  `incoming_request` int(10) unsigned NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=301 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: communMember
#

DROP TABLE IF EXISTS `communMember`;

CREATE TABLE `communMember` (
  `user_id` int(10) unsigned NOT NULL,
  `commun_id` int(10) unsigned NOT NULL,
  `joined` datetime DEFAULT current_timestamp(),
  `member_status` int(10) unsigned NOT NULL,
  `member_power` tinyint(1) DEFAULT NULL,
  PRIMARY KEY (`user_id`,`commun_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: dialog
#

DROP TABLE IF EXISTS `dialog`;

CREATE TABLE `dialog` (
  `dialog_id` int(10) unsigned NOT NULL,
  `deleted_id` text COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `unread_id` text COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `user_id` int(10) unsigned NOT NULL,
  `profiles_id` int(10) unsigned NOT NULL,
  PRIMARY KEY (`user_id`,`dialog_id`),
  UNIQUE KEY `user_id` (`user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: files
#

DROP TABLE IF EXISTS `files`;

CREATE TABLE `files` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `saved_files_user_id` text COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `downloaded_files_user_id` text COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `uploaded_files_user_id` text COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `notes_user_id` text COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `bookmarks_user_id` text COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `user_id` int(10) unsigned NOT NULL,
  `profiles_id` int(10) unsigned NOT NULL,
  PRIMARY KEY (`id`,`user_id`),
  UNIQUE KEY `id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=301 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: friends
#

DROP TABLE IF EXISTS `friends`;

CREATE TABLE `friends` (
  `user_id` int(10) unsigned NOT NULL,
  `profiles_id` int(10) unsigned NOT NULL,
  `friend_id` int(10) unsigned NOT NULL,
  `initiator_user_id` int(10) unsigned NOT NULL,
  `friendship_status` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `friendship_creation` datetime DEFAULT current_timestamp(),
  PRIMARY KEY (`user_id`,`friend_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: friendship
#

DROP TABLE IF EXISTS `friendship`;

CREATE TABLE `friendship` (
  `user_id` int(10) unsigned NOT NULL,
  `profiles_id` int(10) unsigned NOT NULL,
  `friend_id` int(10) unsigned NOT NULL,
  `ongoingrequest_user_id` int(10) unsigned NOT NULL,
  `incomingrequest_user_id` int(10) unsigned NOT NULL,
  `friendssuggestion_id` int(10) unsigned NOT NULL,
  PRIMARY KEY (`user_id`,`friend_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: media
#

DROP TABLE IF EXISTS `media`;

CREATE TABLE `media` (
  `id` int(10) unsigned NOT NULL,
  `video_user_id` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `photo_user_id` blob DEFAULT NULL,
  `music_user_id` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `user_id` int(10) unsigned NOT NULL,
  `profiles_id` int(10) unsigned NOT NULL,
  PRIMARY KEY (`user_id`,`id`),
  UNIQUE KEY `user_id` (`user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: profiles
#

DROP TABLE IF EXISTS `profiles`;

CREATE TABLE `profiles` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `first_name` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL,
  `sur_name` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL,
  `nick_name` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `registration` datetime DEFAULT current_timestamp(),
  `maybe_friend_friendship_suggestion_id` int(10) unsigned NOT NULL,
  `about_user` text COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `sex` char(1) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `political_views` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `drinking` tinyint(1) DEFAULT NULL,
  `smoking` tinyint(1) DEFAULT NULL,
  `fortytwo` tinyint(1) DEFAULT NULL,
  `birthday` datetime DEFAULT NULL,
  `country` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `city` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `online_now` tinyint(1) DEFAULT NULL,
  `online_time` datetime DEFAULT current_timestamp(),
  `email` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=301 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: user
#

DROP TABLE IF EXISTS `user`;

CREATE TABLE `user` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `first_name` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL,
  `sur_name` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL,
  `nick_name` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `registration` datetime DEFAULT current_timestamp(),
  `maybe_friend_friendship_suggestion_id` int(10) unsigned NOT NULL,
  `about_user` text COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `sex` char(1) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `political_views` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `dringking` tinyint(1) DEFAULT NULL,
  `smoking` tinyint(1) DEFAULT NULL,
  `fortytwo` tinyint(1) DEFAULT NULL,
  `birthday` datetime DEFAULT NULL,
  `country` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `city` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `online_now` tinyint(1) DEFAULT NULL,
  `online_time` datetime DEFAULT current_timestamp(),
  `email` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=301 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



